Clint Eastwood direct Oscar winner Angelina Jolie and Oscar nominee John Malkovich in a riveting and unforgettable true story.

Los Angeles, 1928. When single mother Christine Collins (Jolie) leaves for work, her son vanishes without a trace. Five months later, the police reunite mother and son; but he isn't her boy. Driven by one woman's relentless quest for the truth, the cases exposes a world of corruption, captivates the public and changes Los Anglese forever.


